contracts/Storage.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.17;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract Storage {
    
    struct Student{
        string codeApogee;
        string studentName;
        string studentEmail;
        string CNE;
        string niveau;
        string filiere;
        string dateObtention;

        string mention;
        string birthDate;
        string birthPlace;
    }

    Student[] public students;

    function createStudent(string memory codeApogee, string memory studentName, string memory studentEmail, string memory CNE, string memory niveau, string memory filiere, string memory dateObtention, string memory mention, string memory birthDate, string memory birthPlace) public {
        Student memory newStudent = Student({
            codeApogee: codeApogee,
            studentName: studentName,
            studentEmail: studentEmail,
            CNE: CNE,
            niveau: niveau,
            filiere: filiere,
            dateObtention: dateObtention,
            mention: mention,
            birthDate: birthDate,
            birthPlace: birthPlace
        });
        students.push(newStudent);
    }

    function getStudents() external view returns(Student[] memory) {
        return students;
    }

    function deleteLastStudent() external {
        students.pop();
    }

    function updateStudent(string memory codeApogee, string memory studentName, string memory studentEmail, string memory CNE, string memory niveau, string memory filiere, string memory dateObtention) public {
        for (uint i = 0; i < students.length; i++) {
            if (keccak256(bytes(students[i].codeApogee)) == keccak256(bytes(codeApogee))) {
                students[i].studentName = studentName;
                students[i].studentEmail = studentEmail;
                students[i].CNE = CNE;
                students[i].niveau = niveau;
                students[i].filiere = filiere;
                students[i].dateObtention = dateObtention;
                break;
            }
        }
    }


    function getStudent(string memory _codeApogee) public view returns (Student memory) {
        for(uint i = 0; i < students.length; i++){
            if (keccak256(bytes(students[i].codeApogee)) == keccak256(bytes(_codeApogee))){
                return students[i];
            }
        }
    }

}

